import React, { useState } from "react";
import "./App.css";

const App = () => {
  const [user, setUser] = useState([]);

  const loadUser = async () => {
    console.log("Before");
    const response = await fetch("https://reqres.in/api/users?page=1");
    const jsonresponse = await response.json();
    setUser(jsonresponse);
  };
  return (
    <>
      <div className="app">
        <h1>Hello</h1>
        <button onClick={loadUser}>Get Data</button>

        <h2>User:</h2>

        <ul className="layout" >
          {user.map(({ id, first_name, last_name, email }) => (
            <li key={id}>
              <div className="innerDetl" >
              <p>Name : {first_name}</p> 
              <p>userName : {last_name}</p>
              <p>phoneNo : {email}</p>
              </div>
            </li>
          ))}
        </ul>
      </div>
    </>
  );
};
export default App;
